import React from 'react';
import { DragDropContext } from "react-beautiful-dnd";

function App() {
  const onDragEnd = () => {}
  return (
    <DragDropContext onDragEnd={onDragEnd}>
      <span>hello</span>
    </DragDropContext>
  );
}

export default App;
